package algorithms_and_data_structures;

import java.util.HashMap;
import java.util.Map;
import java.util.Objects;

public class Sol {
    public boolean isAnagram(String s, String t) {
        int m = s.length();
        int n = t.length();

        if (m != n) {
            return false;
        }

        Map<Character, Integer> map1 = new HashMap<>();
        Map<Character, Integer> map2 = new HashMap<>();

        for (int i = 0; i < n; i++) {
            map1.put(s.charAt(i), map1.getOrDefault(s.charAt(i), 0) + 1);
            map2.put(t.charAt(i), map2.getOrDefault(t.charAt(i), 0) + 1); // Corrected line
        }
        System.out.println("map1:" + map1);
        System.out.println("map2:" + map2);
        System.out.println("map1Keyset:" + map1.keySet());

        for (Character c : map1.keySet()) {
            if (!map2.containsKey(c) || (!Objects.equals(map1.get(c), map2.get(c)))) {
                System.out.println("char:" + c);
                System.out.println(map2.get(c));
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        Sol sol = new Sol();
        String s = "";
        String t = "";
        System.out.println(sol.isAnagram(s,t));
    }
}
